import React from "react";
import "./App.css"; 
import Mysearchbar from "./Left-clone/Mysearchbar";
import Home from "./Middle-clone/Home";
import Findfrn from "./Right-clone/Findfrn";


function App() {
  return (
    <div className="App">
          <div className style={{display:'flex'}}>
          <Mysearchbar></Mysearchbar>
          <Home></Home>
          <Findfrn></Findfrn>
          </div>


    </div>
  );
}

export default App;
